import React from 'react';
import { useSelector, useDispatch } from 'react-redux'
const AdminsData = () => {
    const { val } = useSelector((state) => state.toggle);
  return (<>
      <div className={`Admin-Container ${val ? "activate" : ""}`}>

      </div>
  </>);
};

export default AdminsData;
